import { UsuarioContext, useUsuarioContext } from '../../contexts/Usuario';
import style from './header.module.css'

export default function Header() {

    const { logout } = useUsuarioContext(UsuarioContext);

    return (

        <header className={`${style.header} bg-dark d-flex flex-column`} style={{ minHeight: '100vh' }}>
        <div className="mt-auto text-center p-3">
            <button className="btn btn-light" onClick={(e) => {
                e.preventDefault();
                logout();
            }}>
                Logout
            </button>
        </div>
    </header>



    )
}
